/* eslint-disable import/prefer-default-export */
import { PAY_SUCCESSFUL } from '../types/userTypes';
import { postPay } from '../service/payServices';

export const fetchPay = (data) => async (dispatch) => {
  const payRes = await postPay(data);
  dispatch({
    type: PAY_SUCCESSFUL,
    payload: payRes.data,
  });
};
